import React, {useState} from 'react'
import { FaBars, FaTimes } from 'react-icons/fa';
import { Nav, NavbarContainer, NavLogo, NavIcon, MobileIcon } from "./Navbar.elements";

export const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo to="/">
                        <NavIcon />
                        FINCORP
                    </NavLogo>
                    <MobileIcon>
                        {click ? <FaTimes /> :
                        <FaBars />}
                    </MobileIcon>
                </NavbarContainer>
            </Nav>
        </>
    )
}
